from gevent import monkey
monkey.patch_all()

import gevent
import urllib.request

# download the jpg from Internet
def jpg_download(img_url, filename):
    try:
        response = urllib.request.urlopen(img_url)
        with open('./jpg/'+filename, 'wb') as jpg_file:
            while True:
                rec_data = response.read(1024)
                if not rec_data:
                    break
                jpg_file.write(rec_data)

    except Exception as e:
        print(f'{filename} download failed')

    else:
        print(f'{filename} download successful!')


